	constructor() {
		let mpan = '2500001735610';
		let serial = '18P5022173';
		let apiKey = 'sk_live_3OB5KAytSf6rhl5GHZITJQkm';
		let consumptionUrl = 'https://api.octopus.energy/v1/electricity-meter-points/' + mpan + '/meters/' + serial + '/consumption/';

		this.mpan = mpan;
		this.serial = serial;
		// this.apiKey = apiKey;
		this.consumptionUrl = consumptionUrl;

		this.chosenMetrics = ['total','avg-daily','weekday-most','num-days'];
		this.data = {};
		this.period = {};

		// By default, the period will be the last 12 months.
		let to = new Date();
		let from = new Date(new Date().setFullYear(to.getFullYear() - 1));
		// this.period.from = new Date('2021-02-01').toISOString();
		this.updatePeriod(from,to);
		console.log('Date From: ' + this.period.from);
		console.log('Date To: ' + this.period.to);

		this.initiatePage();
	}

	updatePeriod(from,to) {
		// from, to: date objects
		if (from != null) {
			from = new Date(from);
			console.log('from not null'); 
			this.period.from = from.toISOString();
		}
		if (to != null) {
			to = new Date(to);
			console.log('to not null'); 
			this.period.to = to.toISOString();
		}

		this.period.duration = this.dateDiffInDays(this.period.from,this.period.to);
	}

	dateDiffInDays(date1,date2) {
		// date differences assuming date2 > date1
		// date1, date2: date objects or date strings
		date1 = new Date(date1);
		date2 = new Date(date2);
		return Math.floor(
			(Date.UTC(
				date2.getFullYear(), 
				date2.getMonth(), 
				date2.getDate()) 
			- Date.UTC(
				date1.getFullYear(), 
				date1.getMonth(), 
				date1.getDate()) 
			) /(1000 * 60 * 60 * 24));
	}

	initiatePage() {
		let profileAvailable;
		// Check if API Key already available.
		if (localStorage.a) {
			this.mpan = localStorage.a;
			this.serial = localStorage.b;
			this.apiKey = localStorage.c;
			profileAvailable = true;
		} else {
			profileAvailable = false;
		}

		// Initiate charts (plots empty datasets)
		this.initialiseFullPeriodChart();
		this.initialiseDayAvgChart();
		this.initialiseWeekAvgChart();

		// If not available, assign data to a default (sample) dataset - else fetch and display the data
		if (!profileAvailable) {
			this.defaultData();
			this.updateCharts();
		} else {this.refreshPage();}
		
	}

