	updateCredentials(creds) {
		this.mpan = creds.mpan;
		this.serial = creds.serial;
		this.apiKey = creds.apiKey;
		if (creds.remember) {
			localStorage.a = creds.mpan;
			localStorage.b = creds.serial;
			localStorage.c = creds.apiKey;
		
			if (!localStorage.apiKey) {
				localStorage.apiKey = '_yoCeda_siTiyEkIpAla_eRAto_NsisihT';
			}
		}

		this.refreshPage();
		document.getElementById('default-data-warning').style.display = 'none';
	}

	async refreshPage() {
		// Fetch 30 min data
		await this.fetchData(10000,'period','');
		
		this.updateCharts();

		this.lastRefresh = new Date();
		console.log('Last Refresh: ' + this.lastRefresh);
		document.getElementById('last-refresh').innerText = this.lastRefresh.toLocaleString().replace(',','');
	}

	updateCharts() {
		// Update chart data
		this.updateFullPeriodChart(this.data.data);
		this.updateDayAvgChart(this.data.data);
		this.updateWeekAvgChart(this.data.data);

		// Update Metrics
		this.updateMetrics();
	}

	async fetchData(pageSize,orderBy='period',groupBy='') {
		// NOTE: if data count > pageSize then API returns the data on multiple pages - this method does not currently iterate through all pages.
		console.log('Fetching data')
		let url = this.consumptionUrl + '?' +
			'period_from=' + this.period.from +
			'&period_to=' + this.period.to +
			'&page_size=' + pageSize +
			'&order_by=' + orderBy +
			'&group_by=' + groupBy;
		console.log(url)
		let options = {
			method:'GET',
			headers: {
				'Content-Type':'application/json',
				'Authorization': 'Basic ' + btoa(this.apiKey+':')
			}
		};

		await fetch(url, options)
			.then(response => {
				// console.log(response)
				return response.json();
			})
			.then(json => {
				console.log('Records Found: ' + json.count);
				// console.log(json);
				this.data['data'] = this.transformData(json.results,'dataset',{in:['interval_start','consumption'],out:['x','y']});
				this.data['recordCount'] = this.data.data.length;
				// console.log(this.data)
			})
			.catch(err => console.log(err));
	}

	transformData(data,transformation,labels={in:['x','y'],out:['x','y']}) {
		// Takes data as array of json objects and returns transformed data.
		// Must define labels for incoming data and expected output labels
		console.log('Transforming data');

		let output;
		
		switch (transformation) {
			case 'dataset':
				// dataset: [{x:?,y:?}]
				output = [];
				let record;
				for (let i=0; i<data.length; i++) {
					record = {};
					record[labels.out[0]] = data[i][labels.in[0]];
					record[labels.out[1]] = data[i][labels.in[1]];
					output.push(record);
				}
				break;
			case 'array-object':
				// array-object: {x:[],y:[]}
				output = {};
				output[labels.out[0]] = [];
				output[labels.out[1]] = [];
				for (let i=0; i<data.length; i++) {
					output[labels.out[0]].push(data[i][labels.in[0]]);
					output[labels.out[1]].push(data[i][labels.in[1]]);
				}
				break;
		}
		return output;
	}

	getAggregation(data,level,mode) {
		// Aggregate the data over the level specified (data passed in must be at lower granularity than the aggregation level).
		// Expect data to be in dataset form of array of objects.
		// Accepted levels: half-hr, hour, weekday, date, month, year
		// mode options: sum, mean
		// Returns array of objects.
		let aggregation = [];
		let meta = {};	// object to track indices and counts.
		let datetime, x, aggId;
		for (let index=0; index<data.length; index++) {
			datetime = new Date(data[index].x);
			// x value is the key in the objects for the output aggregation
			// aggId is an identifier that divides the similar levels apart.
			switch (level) {
				case 'half-hr':
					aggId = datetime.toISOString().slice(0,15);
					x = new Date().toISOString().slice(0,11) + datetime.toISOString().slice(-13);
					break;
				case 'hour':
					aggId = datetime.toISOString().slice(0,13);
					if (mode == 'sum') {
						x = datetime.toISOString().slice(0,13) + ':00:00.000Z';
					} else if (mode == 'mean') {
						x = new Date().toISOString().slice(0,11) + datetime.toISOString().slice(-13,-11) + ':00:00.000Z';
					}
					break;
				case 'weekday':
					x = {0:'Sunday',1:'Monday',2:'Tuesday',3:'Wednesday',4:'Thursday',5:'Friday',6:'Saturday'}[datetime.getDay()];
					aggId = datetime.toISOString().slice(0,10);	// sum records over the whole day.
					break;
				case 'date':
					x = datetime.toISOString().slice(0,11) + '00:00:00.000Z'
					aggId = x
					break;
				case 'month-cat':
					x = {0:'January',1:'February',2:'March',3:'April',4:'May',5:'June',6:'July',7:'August',8:'September',9:'October',10:'November',12:'December'}[datetime.getMonth()];
					aggId = datetime.getFullYear() + '-' + datetime.getMonth();
					break;
				case 'month-date':
					x = new Date(datetime.getFullYear() + '-' + ('0' + (datetime.getMonth() + 1)).slice(-2) + '-01' ).toISOString();
					aggId = datetime.getFullYear() + '-' + datetime.getMonth();
					break;
				case 'year':
					x = String(datetime.getFullYear());
					aggId = x;
					break;
			}

			if (Object.keys(meta).includes(x)) {
				aggregation[meta[x].index].y += data[index].y;
				if (!meta[x].idx.includes(aggId)) {meta[x].idx.push(aggId)};
			} else {
				aggregation.push({x:x,y:data[index].y});
				meta[x] = {
					index: aggregation.length - 1,
					idx: [aggId]
				};
			}
		}

		if (mode == 'mean') {
			for (let i=0;i<aggregation.length;i++) {
				x = aggregation[i].x;
				aggregation[meta[x].index].y /= meta[x].idx.length;
			}
		}

		return aggregation;
	}

	filterData(options) {
		// options: {dateFrom:... , dateTo:...}
		if (Object.keys(options).includes('datefrom')) {
			this.updatePeriod(options.datefrom,null);
		}

		if (Object.keys(options).includes('dateto')) {
			this.updatePeriod(null,options.dateto);
		}

		this.refreshPage();
	}

