	async updateFullPeriodChart(data) {
		// Adjust x-axis
		let axisUnit;
		if (this.period.duration < 3) {
			axisUnit = 'hour';
			data = this.getAggregation(data,'hour','sum');
		} else if(this.period.duration < 500) {
			axisUnit = 'day';
			data = this.getAggregation(data,'date','sum');
		} else if (this.period.duration < 1000) {
			axisUnit = 'month';
			data = this.getAggregation(data,'month-date','sum');
		} else {
			axisUnit = 'year';
			data = this.getAggregation(data,'year','sum');
		}
		console.log('AXIS MODE: ' + axisUnit);

		this.fullPeriodChart.data.datasets[0].data = data;
		this.fullPeriodChart.options.scales.xAxes[0].time.unit = axisUnit;

		this.fullPeriodChart.update();
	}

